import React from "react";

const Content = () => {
  return (
    <>
      <div className="container-fluid ">
        <div className="container">
          <div className="row">
            <h1 className="text-center text-capitalize mx-auto  pt-3 fw-bolder">
              {" "}
              top rated
            </h1>
            <hr />
          </div>
        </div>
        <div className="container">
          <div className="row">
            <h3>movies</h3>
            <h3>series</h3>
            <button class="btn btn-outline-success" type="submit">
              Search
            </button>
          </div>
        </div>
      </div>
    </>
  );
};
export default Content;
